import React from 'react';
import './Style.css'; // Import du fichier CSS

const HomePage = () => {
    return (
        <div className="homepage">
            <nav className="navbar">
                <ul>
                    <li>Shop</li>
                    <li>A propos</li>
                    <li>Contact</li>
                </ul>
            </nav>
            <header>
                <h1>Welcome to ChronoLithe</h1>
                <p>Elegance and minimalism in clock design</p>
            </header>
            <section>
                <p>Explore our unique 3D-printed clock designs, crafted with precision and passion.</p>
                <button>Discover More</button>
            </section>
        </div>
    );
};

export default HomePage;
